import React from 'react';
import { ReactDOM } from 'react';

const HeaderTop = () => {
    return (
        <div class='headerTop'>
          <div class='Icons'>
            Icon1
          </div>
          <div class='Icons'>
            Icon2
          </div>
          <div class='Icons'>
            Icon3
          </div>
          <img class='companyLogo' src = 'https://seeklogo.com/images/T/the-pizza-company-logo-D44DBE70F1-seeklogo.com.png' />
        </div>
      )
}

export default HeaderTop;
